import {
    Register,
  } from 'components';

const App = () => {
    const [token, setToken] = useState('');
    console.log('token: ', token);
    
  
    return <>
      <h1>
        Strangers Things
      </h1>
      <Register setToken={setToken} />
    </>
  }

export default App;
